function Interests() {
  return (
    <div>
      <h5 className="card-title">Interests</h5>
      <p id="interests" className="card-text">
        When I am not busy at work or refining my software development skills, I
        like to keep active in the gym, study game design, keep up with some of
        the latest tech trends, play video games, watch MMA / Kickboxing, jam
        out to good music, and watch anime. I have also been known to dabble in
        some skateboarding.
      </p>
    </div>
  );
}

export default Interests;
